// src/components/UrenregistratieTable.js
import React from 'react';

function UrenregistratieTable({ urenRegistraties }) {
  return (
    <table className="urenregistratie-table">
      <thead>
        <tr>
          <th>Datum</th>
          <th>Starttijd</th>
          <th>Eindtijd</th>
          <th>Uren</th>
          <th>Prijs per uur</th>
          <th>Reiskosten</th>
          <th>Totaal bedrag</th>
        </tr>
      </thead>
      <tbody>
        {urenRegistraties.map((registratie, index) => (
          <tr key={index}>
            <td>{registratie.datum}</td>
            <td>{registratie.starttijd}</td>
            <td>{registratie.eindtijd}</td>
            <td>{registratie.uren}</td>
            <td>€ {registratie.prijsPerUur}</td>
            <td>€ {registratie.reiskosten}</td>
            <td>€ {registratie.totaal}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
}

export default UrenregistratieTable;
